pragma solidity >=0.4.22 <0.9.0;
contract vote {
	struct Candidate{
        //id of candidate
        address id;
        //name of candidate
        string name;
        //votecount of candidate
        uint voteCount;
    }

    event eventVote(
        address indexed _candidateid
        );

        mapping (address => Candidate) public candidates;
